import React from 'react';
import { Route,Redirect} from 'react-router-dom';

const ProtectedRoute = ({children, ...rest}) => {
  return (
    <Route
      {...rest}
      render={() =>
        props.isAuthenticated ? (children) : 
        (<Redirect to={'/cerberus/login'}/>)
      }
    />
  );
}

export default connect()(ProtectedRoute);
